import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Container } from "react-bootstrap";

export default function Nav() {
	return (
		<>
			<link rel="preconnect" href="https://fonts.googleapis.com" />
			<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin />
			<link
				href="https://fonts.googleapis.com/css2?family=Monoton&family=Montserrat&display=swap"
				rel="stylesheet"
			/>
			<div
				// style={{
				// 	display: "flex",
				// 	fontFamily: "Monoton",
				// 	borderBottom: "groove",
				// 	backgroundImage:
				// 		'url("https://cdn.pixabay.com/photo/2016/06/15/08/23/tape-1458416_960_720.png")',
				// 	color: "black",
				// 	height: "18rem",
				// }}
			>
				<img
					src="https://cdn.pixabay.com/photo/2016/10/08/14/38/lens-1723832_960_720.png"
					style={{ maxHeight: "25%", marginTop: "5%", marginLeft: "1%" }}
					alt="Torbka"
				/>
				<h2 style={{ marginTop: "5%", maxWidth:'15%', marginLeft:'3px' }}>Fake Show Book</h2>
			</div>
			<Navbar expand="lg" variant="light" bg="light">
				<Container>
					<Navbar.Brand href="/">
						<u>Discover this week</u>
					</Navbar.Brand>
					<Navbar.Brand href="/aboutus">
						<u>About this page</u>
					</Navbar.Brand>
					<Navbar.Brand href="/contact">
						<u>Contact</u>
					</Navbar.Brand>
				</Container>
			</Navbar>
		</>
	);
}
